import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
	    <div class="App-header">
	    	<img src={logo} alt="Beau's beer"/>
	    </div>
	    <p class="App-intro">Since 2006 Beau’s All Natural has been brewing interesting, tasty beers like our Lug Tread Lagered Ale using the best ingredients & local spring water. Our family takes p    ride in creating unique, wonderful and certified organic craft beer, conceived with honest consideration for the environment and our local communities, and delivered with a sense of fr    iendly relationship. We are an award-winning, local, family-run, organic, and independent brewery.

	   <div class="App-bear">

		<h3>LUG TREAD</h3>
	    	<img src={'../images/beer1.jpg'} alt="beer Lagered"/>
		<p><i>Lagered Ale</i><br/>
		5.2% ABV<br/>
		Beau’s year-round flagship beer is Lug-Tread, our tribute to the classic Kölsch beers of Germany. Lug-Tread is fermented like an ale and cold-aged like a lager, giving it both ale notes and a lager-like crispness. Balanced, crisp, refreshing.</p>

	    </div>
</p>
      </div>
    );
  }
}

export default App;
